　☆アルミファン採用で軽量・コンパクト<br>しっかり風を送る<br>パーソナルにぴったり。<br>必要な時に必要なところにしっかり風を送ります。<br><br>風量 強・弱 2段切り替え式<br>軽量 1.2 kg<br>軽いのでどこへでも簡単に持ち運べます。<br><br>☆持ち運びに便利なハンドル付<br><br>扇風機を持ち運ぶのは意外とたいへん。<br>キッチンや脱衣所、ロフトやトイレなど…<br><br>手軽に持ち運べてどこにでも置ける。<br>そんな一人用扇風機です。<br><br>☆便利な首振り機能<br>スイング（ 首振り ）機能付き<br>首振りの範囲（ 角度 ）は 約 40°。<br><br>☆消し忘れ防止の 4時間自動オフタイマー<br>スイッチON から約 4時間後自動的に電源が切れます。<br>スイッチの切り忘れや就寝時、自動的に電源が切れるので安心です<br><br><br>【仕様】<br>製品寸法 約 110 × 110 × 405 mm<br>製品質量 約 1.2 kg<br>電源 AC 100 V　50 ? 60 Hz<br>消費電力（ 50 ? 60 Hz ） 強：20 W ? 17 W<br>弱：12.5 W ? 11 W<br>風量切替 強 ? 弱<br>オートオフタイマー 約 4時間 自動停止<br>スイング（ 首振り ） 約 40°<br>電源コード有効長 約 1.2 m<br><br>寸法は 幅 × 奥行 × 高さ の順で記載しております。<br>商品改良のため、デザイン、仕様を一部予告なく変更することがありますので、ご了承ください。<br>商品写真は実際の色とは若干異なる場合があります。<br>商品には安全にお使いいただくため、注意表示をしているものがあります。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ツインバード<br>サイズ：約 110 × 110 × 405 mm<br>質量：約 1.2 kg<br>消費電力( 50 ： 60 Hz)：強:20 W ? 17 W 弱:12.5 W ? 11 W<br>カラー：ホワイト<br><br>購入単位：1台<br>配送種別：在庫品</p></td></tr></table><br><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>楽天 通販 電化製品 空調 冷暖房機器 暖房器具 その他暖房器具 ついんばーど ぱーそなるみにたわーふぁん EF-4938W ほわいと  P54045 9N0826 4975058493813 ついんばーど ツインバード タワーファン たわーふぁん ファン ふぁん 温度センサー付きタワーファン 温度センサー 暖房 扇風機 サーキュレーター せんぷうき だんぼう 冷房 れいぼう エコ 小さいタワーファン</font></td></tr></table></font><style type="text/css">
